import React, {Component} from 'react';
import {Route} from 'react-router-dom';



class Form extends Component {
  state ={
    termobusca:'',
    enviou:false
     
  }
  handleChange =(evt)=>{

    this.setState({termobusca: evt.target.value });
  }
  handleSubmit =(evt)=>{
    const {termobusca} =this.state;
    const {onFormSubmit}=this.props;
    this.setState({enviou: true});

    onFormSubmit(termobusca)
    evt.preventDefault()
  }

  render(){
    return (
    <div className="form-inline">
      {this.state.enviou ?(
        <div>
            <header className="move" >
              <form onSubmit={this.handleSubmit}  >
                <input type='text' className="form-control" name='pesquisar' placeholder='Pesquisar' onChange={this.handleChange} />
                <button type='submit' className="btn btn-success">Buscar</button>
                <button  className="btn btn-default" > Voltar </button>
              </form> 
            </header>
        </div>
        ):(
          <div>
              <header className="App-header">
                <form onSubmit={this.handleSubmit}  >
                  <input type='text' className="form-control" name='pesquisar' placeholder='Pesquisar' onChange={this.handleChange} />
                  <button type='submit' className="btn btn-success">Buscar</button>
                </form> 
              </header> 
          </div>    

        )}
       
    </div>
  );
}
}

export default Form;
